INSERT INTO `yt_article` VALUES (5, 7, '海大2021年上半年业绩同比增长47.54%', '<p>7月26日晚，海大集团发布半年度业绩报称，实现营业收入381.91亿元，同比增长47.54%；归属于母公司股东的净利润15.33亿元，同比增长38.82%。上半年公司在饲料产品力优势叠加优质种苗和动保服务的一体两翼驱动下，实现饲料销量881万吨（含自用42万吨），同比增长34%；其中对外销量839万吨，同比增加200万吨销量，增长率为31%。由于原材料持续上涨，公司利用期货套保工具锁定原材料成本，因部分期货套保利润体现在投资收益项目，所以饲料毛利率同比下降1.71个百分点。其中猪饲料销量为197万吨，同比增长148%；禽饲料销量为455万吨，同比增长12%；水产饲料销量187万吨，同比增长21%。</p>', NULL, 1, 1, 130, 1626858504, 1679480894);
INSERT INTO `yt_article` VALUES (6, 6, '转多多即将参加第七届中国（广州）国际渔业博览会', '<p>根据渔博会组委会通知，展会将调整到9月16-18号。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"http://api.ecarboncn.com/upload/20210726/ee0b606aec67ed26f0b2e0009745fe34.jpg\" /></p>', NULL, 1, 1, 438, 1626858592, 1679480859);
INSERT INTO `yt_article` VALUES (7, 6, '转多多中山南头镇服务中心成立', '<p>为了更好地服务客户，贴近客户，公司在中山市南头镇同济西路23号宏基e谷一期4栋六楼成立客户服务中心。该中心功能包括变频增氧机组装、维修及仓储等功能。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"http://api.ecarboncn.com/upload/20210726/755a72485f48c311420f0bcc30985bbb.jpg\" /></p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"http://api.ecarboncn.com/upload/20210726/2cd799858cb759255b031c4a4adbcd66.jpg\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', NULL, 1, 2, 424, 1627301365, 1679480859);
INSERT INTO `yt_article` VALUES (8, 8, '常见鱼类对溶氧值的要求', '<p>鱼类对水中的溶氧变化有一定的适应能力，但溶氧值的变化只能在一定范围内发生。若溶氧值降低到一定低值时，鱼类轻则厌食，重则窒息。因此了解鱼最适宜的溶氧值至关重要。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"http://api.ecarboncn.com/upload/20210726/7b882c5ba6d3457130054b1edd4586ae.png\" width=\"300\" height=\"\" /></p>', NULL, 1, 1, 82, 1627312897, 1679480926);
INSERT INTO `yt_article` VALUES (10, 21, '智能增氧机解决方案', '<p>转多多鱼塘增氧方案由三个部分构成:永磁变频智能增氧机+手机小程序&ldquo;深圳转多多&rdquo;+服务器后台管理程序三部分构成。和传统的增氧机相比，它具有以下几个优势：</p>\n<p>1、节能。在同样的增氧效果下，转多多永磁变频智能增氧机约节省35%左右的电能。以广东省鱼塘养殖为参考，一年节省的电费约为一台智能增氧机的成本。</p>\n<p>2、自我保护等级高。转多多永磁变频智能增氧机内置了变频驱动板，其本身的电路具有缺相、过压、欠压、过流及防雷等保护电路</p>\n<p><img class=\"wscnph\" src=\"http://api.ecarboncn.com/upload/20210809/c6b4cafe23cd716efb49a38745c4f126.jpg\" /></p>', NULL, 1, 1, 444, 1628471368, 1679480748);
INSERT INTO `yt_article` VALUES (11, 23, '定时运行增氧方案', '<p>转多多智能增氧机内置了定时运行控制方案。我们将一天分成四个时间段，从0~24时，每个时间段可由用户自己设置，每个时间段对应的转速也可由用户设置（0速对应停机）。这样用户可根据自己的经验和当地的天气情况进行时间和转速调整。一次设置，永久有效，直到下次变更。</p>', NULL, 1, 2, 133, 1628473986, 1679480803);
INSERT INTO `yt_article` VALUES (12, 23, '溶氧仪联动自动调速增氧方案', '<p>根据溶氧仪检测的含氧量，转多多永磁变频增氧机自动调整转速来使得鱼塘的氧含量达到最佳值。这样可以获得最佳的增氧效果和最高的节能率。</p>', NULL, 1, 1, 133, 1628474168, 1679480803);
INSERT INTO `yt_article` VALUES (13, 8, 'GBT 35941-2018 水产养殖增氧机检测规程', '<p><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://api.ecarboncn.com/upload/20210810/188768bc38e50f98ef7744cad9a95c20.png\" /><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://api.ecarboncn.com/upload/20210810/4c63b5e923a163eeef4ae309bcb6d5c2.png\" /><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://api.ecarboncn.com/upload/20210810/4639e05dc319303eeb7fecd9bb755a56.png\" /><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://api.ecarboncn.com/upload/20210810/114514d93f39b577d17b84c02601a91a.png\" /><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://api.ecarboncn.com/upload/20210810/6f1547f9f9fec317e5aa35b72a50568b.png\" /></p>', NULL, 1, 1, 28, 1628561717, 1679480926);
INSERT INTO `yt_article` VALUES (14, 8, '养殖水体中溶氧的影响因素', '<p>&nbsp;&nbsp;&nbsp;溶解氧是衡量鱼塘水质的最重要的综合性指标。一方面，养殖鱼类需要一定的溶解氧才能生产；另一方面，水体缺氧会导致厌氧细菌繁殖，水质急剧恶化。在比较简单的情况下，影响水体溶解氧主要有大气复氧、有机物降解、硝化反应、光合作用、底泥氧化和微生物呼吸等几个方面。</p>\n<p>&nbsp; &nbsp;</p>\n<p><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://api.ecarboncn.com/upload/20210811/369b77134444d64af9c64a1009400189.png\" /></p>', NULL, 1, 1, 21, 1628643681, 1679480926);
