INSERT INTO `yt_company` VALUES (1, '深圳市翌卡本智能科技有限公司', 'http://api.ecarboncn.com/upload/20210809/7876e440a2f225ccd296d376ea19ddc1.png', '<p><span style=\"font-size: 12pt;\"><span style=\"color: #808080;\">&nbsp; &nbsp; &nbsp;</span><span style=\"color: #808080;\">&nbsp; &nbsp; &nbsp;&nbsp;</span></span></p>\n<p><span style=\"color: #808080; font-size: 12pt;\">&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;深圳市翌卡本智能科技有限公司成立于2016年，是一家以电机及其控制技术为基础，从事高性能特种电机、电 </span><span style=\"font-size: 12pt;\"><span style=\"color: #808080;\">机驱动器</span></span></p>\n<p><span style=\"font-size: 12pt;\"><span style=\"color: #808080;\">以</span></span><span style=\"font-size: 12pt;\"><span style=\"color: #808080;\">及电机控制在各行业应用的</span><span style=\"color: #808080;\">研发，生产、销售及运维的国家级高新技术公司。 </span><span style=\"color: #808080;\">公司通过领先的智能和节</span></span><span style=\"font-size: 12pt;\"><span style=\"color: #808080;\">能产品，构建以大数</span></span></p>\n<p><span style=\"font-size: 12pt;\"><span style=\"color: #808080;\">据为</span></span><span style=\"font-size: 12pt;\"><span style=\"color: #808080;\">基础的渔牧业养殖系统解决方案，为客户提供从数字</span></span><span style=\"font-size: 12pt;\"><span style=\"color: #808080;\">化产品到设备运营维护的多层次服务。 </span><span style=\"color: #808080;\">公司致力于高效使用电能，深</span></span></p>\n<p><span style=\"font-size: 12pt;\"><span style=\"color: #808080;\">度使用</span></span><span style=\"font-size: 12pt;\"><span style=\"color: #808080;\">大数据，持续提高客户生产效率，促进</span></span><span style=\"font-size: 12pt;\"><span style=\"color: #808080;\">碳平衡早日到来，共建和谐的人与自然</span><span style=\"color: #808080;\">关系。</span></span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-size: 12pt;\"><span style=\"color: #808080;\"><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://api.ecarboncn.com/upload/20210809/42d1d192f3f70fee3883dd93cfe20d1d.jpg\" /></span></span></p>\n<p>&nbsp;</p>', 'http://api.ecarboncn.com/upload/20210726/ec29a760fc2301c86b1b5eaa602e97aa.mp4', '<p>中山民众镇海大养殖五场</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://api.ecarboncn.com/upload/20210809/8b133a830fe166713b8584eb13bf0c19.jpg\" /></p>\n<p>&nbsp;</p>\n<p>中山三角镇海大养殖一场</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://api.ecarboncn.com/upload/20210809/8930b8ac61b55c0f93f42fa35ca728b0.jpg\" /></p>\n<p>&nbsp;</p>\n<p>江门台山市大湾村海大养殖二部</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://api.ecarboncn.com/upload/20210809/ff423528e2141ed232bf97e1f811cefc.jpg\" /></p>\n<p>&nbsp;</p>\n<p>中山三角镇海大养殖二场</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://api.ecarboncn.com/upload/20210809/2e06e15085eed32f10fcb8e2bca3477c.jpg\" /></p>\n<p>&nbsp;</p>\n<p>中山三角镇海大养殖二场</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://api.ecarboncn.com/upload/20210809/3eb98366b46bf761b0529ff5873c5159.jpg\" /></p>', '李先生', '15012569980', '0755-86056615', '深圳市光明区公明街道上村社区莲塘工业城铁塔旭发科技园A1栋', 'https://www.taobao.com/', 'https://www.jd.com/', '智慧水产养殖设备供应与运维平台', 'http://api.ecarboncn.com/upload/20210727/0ce606a01549c2249f31f1515941d565.svg', 'http://api.ecarboncn.com/upload/20210726/21880ff15a78c0b7cad8a7c0b5d36f10.jpeg');
