INSERT INTO `yt_product` VALUES (9, 5, '智能变频增氧机', 'http://api.ecarboncn.com/upload/20210726/80fc724f946659f774f090aef2681f24.png', NULL, '<p><span style=\"font-size: 14pt;\">&nbsp;&nbsp; &nbsp;&nbsp;<span style=\"color: #000080;\">&nbsp;</span><span style=\"font-size: 18pt; color: #000000;\">转多多智能变频增氧机是一款以永磁直驱电机和全变频方案为基础开发的全新智能节能型增氧机，该机型配备了4G物联网模块，通过手机小程序&ldquo;深圳转多多&rdquo;即可实现手机控制。</span></span></p>\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;国内首个采用4G物联网模块，信号稳定快速</p>\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;单机即可联网调速，故障告警，电网保护，无需其他控制器</p>\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;定时定速（4段时间及对应速度均可在小程序设置）</p>\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;断电/电网缺相/电网电压过低/故障电话告警</p>\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;停电记忆功能：来电后保持停电前的运行或停机状态</p>\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;通信故障自动运行功能</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"http://api.ecarboncn.com/upload/20210808/ba85228c106196b717c0987a5c92eb87.png\" /> <img class=\"wscnph\" src=\"http://api.ecarboncn.com/upload/20210808/742af789686fa6d72a3a5e93f9159f88.png\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', 1, 1, 1055, 0, NULL, 1627300536, 1679480737);
